import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <div className="rmdb-header">
      <div className="rmdb-header-content">
        <img
          className="rmbd-logo"
          src="./images/reactMovie_logo.png"
          alt="rmbd-logo"
        />
        <img
          className="rmbd-tmdb-logo"
          src="./images/tmdb_logo.png"
          alt="tmbd-logo"
        />
      </div>
    </div>
  );
};

export default Header;
